@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'sound-collection';
}
<div class="banner">
  <h2 class="sound">Sound Collection</h2>
</div>
<div class="spacer">
  <nav>
    <a href="home">Home</a>
    <a href="animal">Animals</a>
    <a href="bird">Birds</a>
    <a href="reptile">Reptiles</a>
  </nav>
</div>

